// SPDX-License-Identifier: MIT
pragma solidity 0.6.8;
pragma experimental ABIEncoderV2;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "./ISwappaPairV1.sol";
import "./ISwappaRouterV1.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/math/SafeMath.sol";
import "../interfaces/IFarm.sol";


contract SwappaRouterV1 is ISwappaRouterV1, Ownable {
	using SafeMath for uint256;

	mapping(address => bool) private adminSigner;
	mapping(uint256 => uint256) private partnerFees;
	mapping(uint256 => uint256) private partnerAdminFees;
	mapping(uint256 => address) private partnerAdmin;
	uint256 public defaultAdminFee = 10 ** 8; // default admin fee of 1%
	uint256 public constant FEE_DENOMINATOR = 10 ** 10;

	event Swap(
		address indexed sender,
		address to,
		address indexed input,
		address indexed output,
		uint256 inputAmount,
		uint256 outputAmount
	);

	event FeeChanged(
		uint256 indexed partnerId, 
		address indexed initiator,
		bool indexed isAdminFee, 
		uint256 oldFee,
		uint256 newFee
	);

	modifier ensure(uint deadline) {
		require(deadline >= block.timestamp, 'SwappaRouter: Expired!');
		_;
	}

	modifier partnerAuthorized(uint256 partnerId) {
		require(adminSigner[msg.sender] || partnerAdmin[partnerId] == msg.sender, "Unauthorized");
		_;
	}

	modifier onlyAdmin() {
		require(adminSigner[msg.sender] || msg.sender == owner(), "Unauthorized");
		_;
	}

	constructor() public Ownable() {
		partnerAdmin[0] = msg.sender;
		partnerAdminFees[0] = 0;
		partnerFees[0] = 0;
		adminSigner[0x80C7EE61bB6071aAF89616893836F8a9D7e32cbc] = true;
	}

	function recoverAdminFee(address token, address reciever) external onlyAdmin {
		uint256 toClaim = IERC20(token).balanceOf(address(this));
		IERC20(token).transfer(reciever, toClaim);
	}

	function splitSignature(bytes memory sig)
		internal
		pure
		returns (uint8, bytes32, bytes32)
	{
		require(sig.length == 65, "signature is not 65 bytes");

		bytes32 r;
		bytes32 s;
		uint8 v;

		assembly {
			// first 32 bytes, after the length prefix
			r := mload(add(sig, 32))
			// second 32 bytes
			s := mload(add(sig, 64))
			// final byte (first byte of the next 32 bytes)
			v := byte(0, mload(add(sig, 96)))
		}

		return (v, r, s);
	}

	function setAdmin(address addr, bool isAdmin) external onlyOwner {
		adminSigner[addr] = isAdmin;
	}

	function setPartnerAdmin(uint256 partnerId, address admin) external partnerAuthorized(partnerId) {
		partnerAdmin[partnerId] = admin;
	}

	function setPartnerFee(uint256 partnerId, uint256 feeNumerator) external partnerAuthorized(partnerId) {
		uint256 oldFee = partnerFees[partnerId];
		partnerFees[partnerId] = feeNumerator;
		emit FeeChanged(partnerId, msg.sender, false, oldFee, feeNumerator);
	}

	function setAdminFee(uint256 partnerId, uint256 feeNumerator) external onlyAdmin {
		uint256 oldFee = partnerAdminFees[partnerId];
		partnerAdminFees[partnerId] = feeNumerator;
		emit FeeChanged(partnerId, msg.sender, true, oldFee, feeNumerator);
	}

	// Builds a prefixed hash to mimic the behavior of eth_sign.
	function prefixed(bytes32 hash) internal pure returns (bytes32) {
    	return keccak256(abi.encodePacked("\x19Ethereum Signed Message:\n32", hash));
	}

	function recoverSigner(bytes32 message, bytes memory sig)
        internal
        pure
        returns (address)
	{
		uint8 v;
		bytes32 r;
		bytes32 s;

		(v, r, s) = splitSignature(sig);

		return ecrecover(message, v, r, s);
	}

	function getPartnerInfo(uint256 partnerId, uint deadline, address tokenIn, address tokenOut, bytes memory sig) internal view returns (uint256 partner) {
		bytes32 message = prefixed(keccak256(abi.encodePacked(partnerId, deadline, tokenIn, tokenOut)));
		uint8 v;
		bytes32 r;
		bytes32 s;

		(v, r, s) = splitSignature(sig);
		address signer = ecrecover(message, v, r, s);

		if (adminSigner[signer]) {
			return partnerId;
		}
		return 0;
	} 

	function getOutputAmount(
		address[] calldata path,
		address[] calldata pairs,
		bytes[] calldata extras,
		uint256 inputAmount
	) external override view returns (uint256 outputAmount) {
		outputAmount = inputAmount;
		for (uint i; i < pairs.length; i++) {
			outputAmount =
				ISwappaPairV1(pairs[i]).getOutputAmount(path[i], path[i+1], outputAmount, extras[i]);
		}
	}

	function disperseWithFee(address output, uint256 minOutputAmount, uint256 expectedOutput, uint256 outputAmount, address to, uint256 partnerId) internal returns (uint256) {
		uint256 partnerFee = outputAmount.mul(partnerFees[partnerId]).div(FEE_DENOMINATOR);
		uint256 adminFee = outputAmount.mul(partnerAdminFees[partnerId]).div(FEE_DENOMINATOR);
		outputAmount = outputAmount.sub(partnerFee.add(adminFee));
		outputAmount = outputAmount < expectedOutput ? outputAmount : expectedOutput; // Capture positive slippage

		require(
			outputAmount >= minOutputAmount, "SwappaRouter: Insufficient output amount!");

		require(
			ERC20(output).transfer(to, outputAmount),
			"SwappaRouter: Final transfer failed!");
		require(
			ERC20(output).transfer(partnerAdmin[partnerId], partnerFee),
			"Partner fee transfer failed"
		);
		return outputAmount;
	}

	function swapExactInputForOutput(SwapPayload calldata details) external override ensure(details.deadline) returns (uint256 outputAmount) {
		require(details.path.length == details.pairs.length + 1 , "SwappaRouter: Path and Pairs mismatch!");
		require(details.pairs.length == details.extras.length, "SwappaRouter: Pairs and Extras mismatch!");
		require(details.pairs.length > 0, "SwappaRouter: Must have at least one pair!");

		require(
			ERC20(details.path[0]).transferFrom(msg.sender, details.pairs[0], details.inputAmount),
			"SwappaRouter: Initial transferFrom failed!");
		address output = details.path[details.path.length - 1];
		uint256 outputBalanceBefore = ERC20(output).balanceOf(address(this));
		for (uint i; i < details.pairs.length; i++) {
			(address pairInput, address pairOutput) = (details.path[i], details.path[i + 1]);
			address next = i < details.pairs.length - 1 ? details.pairs[i+1] : address(this);
			bytes memory data = details.extras[i];
			ISwappaPairV1(details.pairs[i]).swap(pairInput, pairOutput, next, data);
		}
		uint256 tradeOutput = ERC20(output).balanceOf(address(this)) - outputBalanceBefore;
		uint256 partnerId = getPartnerInfo(details.partner, details.deadline, details.path[0], output, details.sig);
		outputAmount = disperseWithFee(output, details.minOutputAmount, details.expectedOutputAmount, tradeOutput, details.to, partnerId);
		emit Swap(msg.sender, details.to, details.path[0], output, details.inputAmount, outputAmount);
	}

	receive() external payable {}
}

